.page-header-menu ul.main-navigation li a {
  font-size: 16px;
  color: white !important;
  line-height: 40px;
  font-weight: bold;
  padding: 0 12px;
}
.page-header-menu .sub_navigation li.active,
.page-header-menu ul.main-navigation li.active {
  background: rgba(0, 0, 0, 0.3);
}
.page-header-menu.sub-sub-nav {
  background: #143F4E;
  border-top: 2px solid rgba(0, 0, 0, 0.25);
}
.page-header-menu.sub-sub-nav ul li a {
  font-size: 14px;
  color: white !important;
  line-height: 32px;
  font-weight: bold;
  padding: 1px 15px;
  display: inline-block;
}

table th a {
  color: white !important;
}

.page-content {
  margin-top: 0px;
}

#myPatients .form-group .control-label, #activatedPatients .form-group .control-label {
  margin-bottom: 5px;
}

.privacy-tick-label {
  margin-left: 10px;
}

.timeline.container {
  padding-left: 20px;
}

@media (min-width: 1200px) {
  .timeline.container {
    width: 1170px;
  }
}
.timeline .page-actions li {
  clear: none;
  margin: 0px 5px !important;
}

.page-head-title h1, #helpText {
  margin: 0px;
}

#exportPlanRadioGroup .niceRadio {
  margin-right: 20px;
}

#unregisteredPatientInSelectionWarning {
  text-align: left;
}

form.add-team fieldset {
  border: 0;
}
form.add-team fieldset legend {
  color: #0D475D;
  margin: 5px 0px 10px 0;
  font-size: 32px;
}

#carers-to-be-included {
  padding-bottom: .8em;
}
#carers-to-be-included h3 {
  display: block;
  padding-bottom: .8em;
}
#carers-to-be-included label {
  display: inline-block;
  padding-right: 1.2em;
}
#carers-to-be-included label input, #carers-to-be-included label span {
  display: inline-block;
  min-height: 27px;
  line-height: 27px;
  vertical-align: middle;
}
#carers-to-be-included label input[type="checkbox"] {
  margin-right: 0;
}
