$(document).ready(function(){

  $(".link-start-questionnaire").on("click", function(e){
    $("#start-questionnaire").modal('show');
    //note the click target can be the icon which is a child of the <a> containing the data-recipientid:
    var recipientId = $(e.target).attr('data-recipientid') || $(e.target).parent().attr('data-recipientid');
    $("#start-questionnaire #recipient-id").val(recipientId);
  });

  //automatically click a link for table rows with the autoclick-link class
  $('tr.autoclick-link td').not('.select').on("click", function(event){
    if(!($(event.target).is('input') || $(event.target).is('a') || $(event.target).is('label.nice-checkmark'))){
      if($(this).parent().find('a.link').length===1){
        var a = $(this).parent().find('a.link')[0];
        window.location = $(a).attr('href');
      }
    }
  });

  $('input[type="checkbox"]:not(.hidden):not(.radio)')
    .filter(function() { return (!$(this).parent().hasClass('checkbox-new')) })
    .each(function(index) {
      var id = $(this).attr('id');
      if($.trim(id)===''){
        id = 'niceCheckBox'+index;
        $(this).attr('id', id);
      }
      $(this).after("<label for='"+id+"' class='nice-checkmark'></label>");
    });

  var checkChange = function(){
    var parentForm = $(this).parents('form')[0],
        selectedCount,
        checkboxPathInTable = 'td.select input:not(.ignore-count):checked',
        checkboxPathInList = 'ul.dto-table .select input:not(.ignore-count):checked';

    if($(parentForm).find(checkboxPathInTable).length>0) {
        selectedCount = $(parentForm).find(checkboxPathInTable).length;
    }
    else{
        selectedCount = $(parentForm).find(checkboxPathInList).length;
    }
    $(parentForm).find('span.select-count').text(selectedCount);
  };

  $('td.select input[type="checkbox"]').on("change", checkChange);
  $('ul.dto-table .select input[type="checkbox"]').on("change", checkChange);
  checkChange();


  // hide datepicker plugin when date form fields are focused
  $(".form-control-datepicker").on("focus", function(e){
    $(".dpDiv").css({'display':'none','visibility':'hidden'})
  });

  // main subnav
  $(".btn-sub-nav-left,.btn-sub-nav-right").on("click", function(){
    var direction = $(this).attr('data-direction');
    scrollSubNav(direction);
  });

  $(".traffic-dropdown").on("click", function(e){
    // check if color was selected, set it
    var $li = $(e.target).closest('li');
    if($li.length > 0){
      $(e.currentTarget).find('.large-key').attr('class','key large-key ' + $li.attr('data-severity-css'));
    }
    $(this).toggleClass('open');
  });

  var dataTargetClass = "data-target-class";
  $(".btn-group-measurements .btn").on("click", function(e){
    var $currentTarget = $(e.currentTarget);

    function showClickedCategory() {
      $("#myMeasurements").attr('class', $currentTarget.attr(dataTargetClass));
    }

    showClickedCategory();
    updateDropdown($currentTarget, dataTargetClass)
  });

  updateSelectedButton(dataTargetClass);

  function scrollSubNav(direction){
    var scrollPage = parseInt($(".page-header-menu .sub-nav").attr('data-scroll-position'),10);
    var $lastSubnavItem = $(".page-header-menu .sub-nav li:last-child");
    var atEnd = ($lastSubnavItem.offset().left + $lastSubnavItem.width()) < $(".page-header-menu .container").width();
    var marginLeftOffset = 30;
    var subnavItemWidth = $(".page-header-menu .sub-nav li:first-child").width() + 1.5;
    var subNavWidth = $(".page-header-menu .sub-nav").width()
    var nearEnd = (subNavWidth + 2 * subnavItemWidth) > $(".page-header-menu .sub-nav li").length * subnavItemWidth;

    if(direction === "right" && !atEnd) {
      scrollPage++;
      $(".page-header-menu .sub-nav")
        .attr('data-scroll-position', scrollPage)
        .css('margin-left',- (subnavItemWidth * scrollPage * 2) + marginLeftOffset);
      $(".btn-sub-nav-left").removeClass('disabled');
      if(nearEnd) {
        $(".btn-sub-nav-right").addClass('disabled');
      }
    } else if(direction === "left" && scrollPage > 0) {
      scrollPage--;
      $(".page-header-menu .sub-nav")
        .attr('data-scroll-position', scrollPage)
        .css('margin-left', - (subnavItemWidth * scrollPage * 2) + marginLeftOffset);
      $(".btn-sub-nav-right").removeClass('disabled');
      if(scrollPage === 0) {
        $(".btn-sub-nav-left").addClass('disabled');
      }
    }
  }
  $('a[rel*=modal]').leanModal({ top : 200, closeButton: ".close-modal" });

  initSelect2();

  // This is for checkboxes that should act like radio buttons
  $(".checkboxes-become-radio input[type='checkbox']").on("change", function(){
      $(".checkboxes-become-radio input[type='checkbox']").prop('checked',false);
      $(this).prop('checked',true);
  });

  $(".nav-user-details .switch-teams-link").on("click", function(e){
    e.preventDefault();

    var teamId = $(e.target).attr('data-value');
    $("#switch-team-form #selectedTeam").val(teamId);
    console.log(teamId)
    $("#switch-team-form").submit();
  });

  $(".manage-profile-submit").on("click", function(e){
    if($("#password_input").val().length === 0){
      $("#password_input").parent().addClass('error');
      $("#password_input").siblings('.error').html('MISSING PASSWORD');
      e.preventDefault();
      e.stopPropagation();
      return false;
    } else {
      $("#manageProfile_form").submit();
      return true;
    }
  });

  $(document).on("click", function (e) {
    var expanded = "expanded";
    var expandableClasses = ".dots, .info, .btn-group-responsive, .report-wrapper";
    var $target = $(e.target);
    var $closest = $target.closest(expandableClasses);

    var removeExpanded = function () {
      $(expandableClasses).each(function (index, el) {
        $(el).removeClass(expanded);
      });
    };

    // Retract the current element if it is expanded
    if ($closest.hasClass(expanded)) {
      $closest.removeClass(expanded);
      return;
    }

    // Explicitly remove any existing expanded elements
    removeExpanded();

    // Expands the current expandable element
    $closest.addClass(expanded);

    // Special case for building the dropdown menu
    if ($target.hasClass("dots")) {
      var $dropdown = $target.children(".dropdown");
      var borderWidth = ($target.outerWidth() - $target.innerWidth())/2;
      $dropdown.css("margin-left", $target.width() - $dropdown.outerWidth() + borderWidth);
    }

    //close the dropdown
    $('.free-text-select-freetext').select2("close");
  });

  checkInputs();

  $(document).on("click", ".dropdown-item", function (e) {
    var action = $(this).find('.data-point-action');
    if (action.length === 1) {
      action[0].click();
    }
  });

  $(".clickable-data-point").click(function (e) {
    var target = $(e.target);
    if (!target.hasClass("dots") && !target.hasClass("info")) {
      window.location = $(this).attr('data-details-url');
    }
  });

  $(".input-error").on("keyup change", function() {
    $(this).removeClass("input-error");
  });

  var mandatoryFields = $("[data-validation*='mandatory-field']");
  if (mandatoryFields.length > 0) {
    toggleSubmitDisabled(mandatoryFields);
    mandatoryFields.on("keyup change", function() {
      toggleSubmitDisabled(mandatoryFields);
    });
  }
});

/* Checks niceRadio buttons and new checkboxes. See niceRadio.tagx and checkbox.tagx */
function checkInputs() {
  var checkedInputs = $(".niceRadioInput.checked");
  checkedInputs = checkedInputs.add($(".checkbox-new .checked"));
  checkedInputs.attr("checked", true).removeClass("checked");
}

/**
 * Makes the $target active copies its or the active button's text and attribute to an always visible selected button
 *
 * @param $target the candidate element to be the active button
 * @param attributeToCopy the attribute that should be copied over from the active button to the selected button
 */
function updateDropdown($target, attributeToCopy) {
  if (!$target.hasClass('active')) {
    moveActiveClassTo($target);
    updateSelectedButton(attributeToCopy, $target);
  }
}

function moveActiveClassTo($target) {
  var active = 'active';
  $target.addClass(active).siblings('.' + active).removeClass(active);
}

/**
 * Copies the text and the given attribute with its value of the active button to an always visible selected button
 * in the dropdown
 *
 * @param attributeToCopy the attribute that will be copied over from the active button
 */
function updateSelectedButton(attributeToCopy, $target) {
  var $selectedButton = $("#button-selected");
  var $activeButton = $(".btn-group-responsive button.active");
  $selectedButton.attr(attributeToCopy, ($target || $activeButton).attr(attributeToCopy));
  $selectedButton.children('span').text(($target || $activeButton).text());
}

/**
 * Called by calendar.js when date picker is closed, change triggered in the input text box for validation
 */
function datePickerClosed(targetDateField) {
  $(".form-control-datepicker").trigger("change");
}

function initSelect2() {
  // Generic FreeText Select Inputs
  $("select.free-text-select-options").each(function(i,obj){
    var $selectOptions = $(obj);

    var selectedOption = $selectOptions.val();
    var selected = [];

    var freeTextOptions = $selectOptions.find("option").map(function() {
      var opt = {};
      opt.id = $(this).val();
      opt.text = $(this).text();

      if (selectedOption && opt.id === selectedOption) {
        selected.push(opt);
      }

      return opt;
    }).get();

    var $freeTextInput = $selectOptions.next('.free-text-select-freetext');
    var $freeTextInputField = $selectOptions.siblings('.free-text-input-field');

    $freeTextInput.select2({
      tags: freeTextOptions,
      placeholder: $freeTextInput.attr('data-placeholder'),
      maximumSelectionSize: 1,
      containerCssClass: "free-text-input",
      formatSelectionTooBig: ''
    });

    // Free text input overrides any selection from the options list.
    var freeTextContent = $freeTextInputField.val();
    if (freeTextContent) {
      selected = [{id: freeTextContent, text: freeTextContent}];
    }

    $freeTextInput.select2("data", selected);
    var $selectContainer = $selectOptions.siblings('.select2-container');

    $freeTextInput
        .on("change", function(e) {
          var selectedIDs = e.val;
          if (selectedIDs && selectedIDs.length > 0) {
            var selectedID = selectedIDs[0];
            var found = false;
            for (var i = 0; i < freeTextOptions.length; i++) {
              if (freeTextOptions[i].id === selectedID) {
                found = true;
                break;
              }
            }

            // Apply to hidden fields
            if (found) {
              $freeTextInputField.val('');
              $selectOptions.val(selectedID);
            } else {
              $selectOptions.val('');
              $freeTextInputField.val(selectedID);
            }

            $selectContainer.find('.select2-search-field').hide();
            $selectContainer.attr('tabIndex', '0');
            $selectContainer.focus();
          } else {
            $selectOptions.val('');
            $freeTextInputField.val('');
            $selectContainer.find('.select2-search-field').show();
          }
        });

    $selectContainer.on("click", function(){
      var selectedText = $selectContainer.find('.select2-search-choice').find('div').text();
      if (selectedText !== '') {
        $selectContainer.find('.select2-search-choice-close').click();
        $selectContainer.find('.select2-search-field').show();
        $selectContainer.attr('tabIndex', '-1');
        $freeTextInput.select2('search', selectedText);
      }
    });
  });

  // chosen select boxes for selecting patients in send forms / discussions / call patient
  var select2PlaceholderText =  $("select.select2").attr('data-placeholder');
  $(".select2").select2({
    placeholder: select2PlaceholderText,
    matcher: function (term, text) {
      var regex = '(?=.*?' + term.toUpperCase().replace(/ /gi,')(?=.*?') + ')^.*$';
      return RegExp(regex,'igm').test(text)
    }
  });

  $(".select2").on("change", function (e) {
    if(e.hasOwnProperty('added')) {
      $("#recipientId_"+e.added.id).prop('checked',true);
    } else if (e.hasOwnProperty('removed')) {
      $("#recipientId_"+e.removed.id).prop('checked',false);
    }
  });

  // chosen select boxes for selecting single patient ( used in startCall.jsp for eg )
  var $selectSingleRecipient = $("select.select-single-recipient");
  $selectSingleRecipient.select2({
    placeholder: "Click here to choose recipient",
    maximumSelectionLength: 1,
    matcher: function(term, text) {
      if($selectSingleRecipient.val() && $selectSingleRecipient.val().length >= 1){
        return null;
      }
      var regex = '(?=.*?' + term.toUpperCase().replace(/ /gi,')(?=.*?') + ')^.*$';
      return RegExp(regex,'igm').test(text)
    }
  });
