function Accessibility() {
    // Define values for keycodes
    var ENTER      = 13;
    var SPACE      = 32;
    var ESC        = 27;
    var TAB        = 9;
    var LEFT       = 37;
    var UP         = 38;
    var RIGHT      = 39;
    var DOWN       = 40;

    var self = this;

    $(document).ready(function () {
        new Utils(); //needed for "includes" on IE

        self.initSelect2Accessibility();

        //nasty hack to hide empty breadcrumb... I can't yet find a way of not rendering it using struts tags
        //so this is the easiest workaround for now.
        $('.page-head-title h1').add('li#breadcrumbPageTitle').each(removeIfHasBlankText);

        function removeIfHasBlankText() {
            var $element = $(this);
            if ($.trim($element.text()) === '') {
                $element.remove();
            }
        }

        $(".aria-invalid").each(function() {
            this.setAttribute("aria-invalid", "true");
            var fieldError = $("." + this.id + "_describes");
            if (fieldError) {
                fieldError.attr("role", "alert");
                var fieldErrorId = fieldError.attr("id");
                if (fieldErrorId) {
                    this.setAttribute("aria-describedby", fieldErrorId);
                }
            }
        });


        $(document).on("click", function (e) {
            var $target = $(e.target);

            //if this is an expandable menu focus the first option
            var controlsId = $target.attr("aria-controls");
            if ($("#" + controlsId) && $("#" + controlsId).attr("role") === 'menu') {
                $target.find("[role='menuitem']").first().focus();
            }
        });

        $(document).on("keypress", function (e) {
            var $target = $(e.target);

            //treat spacebar and enter key as clicks on elements that should function as buttons
            if ($target.hasClass("clickable-action") ||
                $target.attr("role") === "button") {
                if (e.which === ENTER || e.which === SPACE) {
                    e.preventDefault();
                    $(e.target).click();
                }
            }
        });

        $(document).on("keydown", function (e) {
            var $target = $(e.target);

            //radio buttons
            if ($target.attr("role") === "radio") {
                //move with arrow keys
                if ([UP, LEFT, DOWN, RIGHT].includes(e.which)) {
                    self.moveWithArrowKeys(e, $target.parents("[role='radiogroup']").find("[role='radio']"),
                        [UP, LEFT], [DOWN, RIGHT]);
                }
            }

            //menus
            if ($target.attr("role") === "menuitem") {
                //move with arrow keys
                if (e.which === UP || e.which === DOWN) {
                    self.moveWithArrowKeys(e, $target.parents("[role='menu']").find("[role='menuitem']"),
                        [UP], [DOWN]);
                }

                //close the dropdown with escape or when tabbing away
                if (e.which === ESC || e.which === TAB) {
                    var menuId = $target.parents("[role='menu']")[0].id;
                    $("[aria-controls='" + menuId +"']").removeClass("expanded").focus();
                }
            }
        });
    });

    this.moveWithArrowKeys = function (e, items, backwardsKeys, forwardKeys) {
        e.preventDefault();
        var currentIndex = items.index($(e.target));
        var lastIndex = items.length - 1;
        var desiredIndex;
        if (backwardsKeys.includes(e.which)) {
            desiredIndex = currentIndex - 1 >= 0 ? currentIndex - 1 : lastIndex;
        } else if (forwardKeys.includes(e.which)) {
            desiredIndex = currentIndex + 1 <= lastIndex ? currentIndex + 1 : 0;
        }
        items[desiredIndex].focus();
    };

    this.initSelect2Accessibility = function () {
        // Generic FreeText Select Inputs
        $("select.free-text-select-options").each(function(i,obj) {
            var $selectOptions = $(obj);
            var $freeTextInput = $selectOptions.siblings('input.free-text-select-freetext');
            var $selectContainer = $selectOptions.siblings('.select2-container');
            var $selectInput = $selectContainer.find('.select2-input');

            //add aria labels
            $selectContainer.attr('aria-label', getInputAriaLabel() + ' ' + window.pkb.a11y.pressToChangeLabel);
            $selectInput.attr('aria-label', getInputAriaLabel() + ' ' + window.pkb.a11y.typeLabel);

            //hide irrelavant elements
            $selectContainer.find('.select2-offscreen').remove();
            $selectOptions.attr('aria-hidden', true);
            $selectContainer.find('.select2-search-choice-close').attr('aria-hidden', true);

            //click on enter
            $selectContainer.on("keypress", function(e){
                if (e.which === ENTER) {
                    e.preventDefault();
                    $selectContainer.click();
                }
            });

            //open the dropdown when it is first focussed
            $selectInput.on("focus", function(e){
                if (e.target === this
                    && e.target.innerText === ''
                    && $selectContainer.find('.select2-search-choice').find('div').text() === '') {
                    $freeTextInput.select2("open");
                }
            });

            //add extra aria-labels when a selection is made
            var $status = $('.select2-hidden-accessible');
            $freeTextInput.on("change", function() {
                var selectedText = $selectContainer.find('.select2-search-choice').find('div').text();
                var existingAriaLabel = $selectContainer.attr("aria-label");
                var standardPrefix = existingAriaLabel.substring(0,
                    existingAriaLabel.indexOf(window.pkb.a11y.pressToChangeLabel) +
                    window.pkb.a11y.pressToChangeLabel.length);
                $selectContainer.attr('aria-label', standardPrefix + ' ' + selectedText);
