            });


            //add aria-labels to the options
            function addAriaLabelsToOptions() {
                $(".select2-result-label").each(function () {
                    $(this).attr("aria-label", this.innerText + ' ' + window.pkb.a11y.pressToSelectLabel);
                });
            }

            $freeTextInput.on("select2-open search", function() {
                //remove the mask so that clicking outside of dropdown can close the options while clicking in it will not
                $(".select2-drop-mask").remove();
                addAriaLabelsToOptions();
            });

            $selectInput.on("keyup", function() {
                addAriaLabelsToOptions();
            });

            $selectContainer.on("click", function(e) {
                addAriaLabelsToOptions();
                //close any other open select2s to avoid having two open at the same time
                $(".select2-container").each(function() {
                    if (!this.contains(e.target)) {
                        $(this).select2("close");
                    }
                });
            });

            //also add aria label to aria-live region as nvda won't read it otherwise
            $selectInput.on("focus", function() {
                var ariaLabel = getInputAriaLabel() + ' ' + window.pkb.a11y.typeLabel;
                if ($status.text().indexOf(ariaLabel) === -1){
                    $status.prepend(ariaLabel);
                }
            });

            function getInputAriaLabel() {
                if ($freeTextInput.attr('data-aria-label')) {
                    return $freeTextInput.attr('data-aria-label')
                } else if ($freeTextInput.attr('data-aria-labelledby')) {
                    return $('#' + $freeTextInput.attr('data-aria-labelledby')).text().trim();
                }
                return '';
            }
        });
    };
}

if (!window.pkb.accessibility) {
    window.pkb.accessibility = new Accessibility();
}
