function Utils() {

  var dataLayer = new DataLayer(),
      templateCache = {};

  this.getConfigs = function (package) {
    return dataLayer.localGet("/js/" + package + "/config.json");
  };


  // Get task data
  this.getData = function (url) {
    return dataLayer.restGet({
      url: url
      // Default dataType from graphs/config.json
    });
  };

  this.getData = function (url, datatype) {
    return dataLayer.restGet({
      url: url,
      dataType: datatype
    });
  };

  // Get HTML template from html files
  this.getHTMLTemplate = function (package, id) {
    if (!templateCache[id]) {
      templateCache[id] = dataLayer.localGet("/js/" + package + "/templates/" + id + ".html");
    }
    return templateCache[id];
  };


  // Remove unnecessary whitespace between html elements
  this.removeHTMLWhiteSpace = function (element) {
    element.html($.trim(element.html().replace(/>\s+</g, "><")));
  };


  // Get query string parameteres from url
  this.getQueryParameter = function (name, url) {
    if (!url) {
      url = window.location.href;
    }
    name = name.replace(/[\[\]]/g, "\\$&");
    var regex = new RegExp("[?&]" + name + "(=([^&#]*)|&|#|$)"),
        results = regex.exec(url);
    if (!results) return null;
    if (!results[2]) return '';
    return decodeURIComponent(results[2].replace(/\+/g, " "));
  };

  // Function delayer
  this.delayInput = (function () {
    var timer = 0;
    return function (callback, ms) {
      clearTimeout(timer);
      timer = setTimeout(callback, ms);
    };
  })();

  // Unescape name
  this.unescape = function (name) {
    return JSON.parse('"' + _.unescape(name) + '"');
  };

  if (!String.prototype.format) {
    String.prototype.format = function () {
      var args = arguments;
      return this.replace(/{(\d+)}/g, function (match, number) {
        return typeof args[number] != 'undefined' ? args[number] : match;
      });
    };
  }

  // flatMap is not supported on IE and old browsers
  if (Array.prototype.flatMap === undefined) {
    Array.prototype.flatMap = function(f) {
      return this.map(f).reduce(function(x, y) { return x.concat(y)}, []);
    }
  }

  // includes is not supported on IE
  if(!Array.prototype.includes) {
    Array.prototype.includes = function(search) {
      return this.indexOf(search) > -1;
    }
  }
}
