/* Layout */
/* =======================
   Layout/Footer
   ======================= */
footer {
  min-height: 40px;
  background-color: #014151;
}
footer .select-language {
  margin-top: 5px;
}
footer .select-language .bfh-selectbox-toggle {
  background-color: rgba(255, 255, 255, 0.2);
  border: 1px solid rgba(255, 255, 255, 0.1);
}
footer .select-language .bfh-selectbox-toggle .bfh-selectbox-option {
  color: white;
}
footer .bottom-row {
  display: flex;
  flex-wrap: wrap;
  justify-content: space-around;
  margin-bottom: 5px;
}
footer .bottom-row #select-locale, footer .bottom-row .text-white {
  margin: 10px 0 0 0;
}
footer .bottom-row #select-locale, footer .bottom-row .text-white {
  display: flex;
  justify-content: center;
}
footer .bottom-row #select-locale {
  height: 35px;
  min-width: 194px;
  flex-basis: 194px;
  align-self: center;
}
footer .bottom-row .text-white {
  text-align: center;
  min-width: 247px;
  flex-basis: 247px;
  flex-direction: column;
  line-height: 24px;
  float: none;
}
footer .bottom-row .copyright {
  padding-right: 10px;
}

footer #footer-inner {
  background-color: #014151;
}

.text-white {
  color: #FFF;
  float: right;
  font-size: 12px;
  font-weight: 600;
  line-height: 40px;
  margin-left: 20px;
}

.copyright {
  padding-right: 40px;
  background: url("/images/2014/pkb-footer-logo.png?v=570-RC1-79-g2a6f0a3") no-repeat 100% 50%;
}

.centered {
  display: block;
  vertical-align: middle;
  margin-left: auto;
  margin-right: auto;
  text-align: center;
  /*handles the horizontal centering*/
  max-width: 960px;
  /*Put in to prevent huge widths messing up the screen width and sub navs*/
}

.footer-team-img {
  padding-top: 24px;
  margin-bottom: 35px;
  max-width: 100%;
}

.mobile-optimized .footer-team-img {
  padding-top: 0;
  margin-bottom: 25px;
}

.footer-team-row {
  position: relative;
  border-radius: 4px;
  overflow: hidden;
}
.footer-team-row .team-address-col {
  display: table;
}
.footer-team-row .team-details-panel {
  background: white;
  line-height: 18px;
  font-size: 14px;
}
.footer-team-row .team-image-cell {
  width: 50%;
  background-position: center center;
  background-size: cover;
  background-repeat: no-repeat;
}
.footer-team-row .team-image-fullwidth-row .team-image-cell {
  height: 250px;
}

@media (max-width: 768px) {
  .footer-team-row .team-image-cell {
    width: 100%;
  }
}
.contact-icon {
  background: #C9C9C9;
  border-radius: 100%;
  color: white;
  font-size: 24px;
  width: 40px;
  display: inline-block;
  height: 40px;
  line-height: 40px;
