$(document).ready(function(){

  $(".link-start-questionnaire").on("click", function(e){
    $("#start-questionnaire").modal('show');
    //note the click target can be the icon which is a child of the <a> containing the data-recipientid:
    var recipientId = $(e.target).attr('data-recipientid') || $(e.target).parent().attr('data-recipientid');
    $("#start-questionnaire #recipient-id").val(recipientId);
  });

  //automatically click a link for table rows with the autoclick-link class
  $('tr.autoclick-link td').not('.select').on("click", function(event){
    if(!($(event.target).is('input') || $(event.target).is('a') || $(event.target).is('label.nice-checkmark'))){
      if($(this).parent().find('a.link').length===1){
        var a = $(this).parent().find('a.link')[0];
        window.location = $(a).attr('href');
      }
    }
  });

  $('input[type="checkbox"]:not(.hidden):not(.radio)')
    .filter(function() { return (!$(this).parent().hasClass('checkbox-new')) })
    .each(function(index) {
      var id = $(this).attr('id');
      if($.trim(id)===''){
        id = 'niceCheckBox'+index;
        $(this).attr('id', id);
      }
      $(this).after("<label for='"+id+"' class='nice-checkmark'></label>");
    });

  var checkChange = function(){
    var parentForm = $(this).parents('form')[0],
        selectedCount,
        checkboxPathInTable = 'td.select input:not(.ignore-count):checked',
        checkboxPathInList = 'ul.dto-table .select input:not(.ignore-count):checked';

    if($(parentForm).find(checkboxPathInTable).length>0) {
        selectedCount = $(parentForm).find(checkboxPathInTable).length;
    }
    else{
        selectedCount = $(parentForm).find(checkboxPathInList).length;
    }
    $(parentForm).find('span.select-count').text(selectedCount);
  };

  $('td.select input[type="checkbox"]').on("change", checkChange);
  $('ul.dto-table .select input[type="checkbox"]').on("change", checkChange);
  checkChange();


  // hide datepicker plugin when date form fields are focused
  $(".form-control-datepicker").on("focus", function(e){
    $(".dpDiv").css({'display':'none','visibility':'hidden'})
  });

  // main subnav
  $(".btn-sub-nav-left,.btn-sub-nav-right").on("click", function(){
    var direction = $(this).attr('data-direction');
    scrollSubNav(direction);
  });

  $(".traffic-dropdown").on("click", function(e){
    // check if color was selected, set it
    var $li = $(e.target).closest('li');
    if($li.length > 0){
      $(e.currentTarget).find('.large-key').attr('class','key large-key ' + $li.attr('data-severity-css'));
    }
    $(this).toggleClass('open');
  });

  var dataTargetClass = "data-target-class";
  $(".btn-group-measurements .btn").on("click", function(e){
    var $currentTarget = $(e.currentTarget);

    function showClickedCategory() {
      $("#myMeasurements").attr('class', $currentTarget.attr(dataTargetClass));
    }

    showClickedCategory();
    updateDropdown($currentTarget, dataTargetClass)
  });

  updateSelectedButton(dataTargetClass);

  function scrollSubNav(direction){
    var scrollPage = parseInt($(".page-header-menu .sub-nav").attr('data-scroll-position'),10);
    var $lastSubnavItem = $(".page-header-menu .sub-nav li:last-child");
