/**
 * Makes the $target active copies its or the active button's text and attribute to an always visible selected button
 *
 * @param $target the candidate element to be the active button
 * @param attributeToCopy the attribute that should be copied over from the active button to the selected button
 */
function updateDropdown($target, attributeToCopy) {
  if (!$target.hasClass('active')) {
    moveActiveClassTo($target);
    updateSelectedButton(attributeToCopy, $target);
  }
}

function moveActiveClassTo($target) {
  var active = 'active';
  $target.addClass(active).siblings('.' + active).removeClass(active);
}

/**
 * Copies the text and the given attribute with its value of the active button to an always visible selected button
 * in the dropdown
 *
 * @param attributeToCopy the attribute that will be copied over from the active button
 */
function updateSelectedButton(attributeToCopy, $target) {
  var $selectedButton = $("#button-selected");
  var $activeButton = $(".btn-group-responsive button.active");
  $selectedButton.attr(attributeToCopy, ($target || $activeButton).attr(attributeToCopy));
  $selectedButton.children('span').text(($target || $activeButton).text());
}

