function initSelect2() {
  // Generic FreeText Select Inputs
  $("select.free-text-select-options").each(function(i,obj){
    var $selectOptions = $(obj);

    var selectedOption = $selectOptions.val();
    var selected = [];

    var freeTextOptions = $selectOptions.find("option").map(function() {
      var opt = {};
      opt.id = $(this).val();
      opt.text = $(this).text();

      if (selectedOption && opt.id === selectedOption) {
        selected.push(opt);
      }

      return opt;
    }).get();

    var $freeTextInput = $selectOptions.next('.free-text-select-freetext');
    var $freeTextInputField = $selectOptions.siblings('.free-text-input-field');

    $freeTextInput.select2({
      tags: freeTextOptions,
      placeholder: $freeTextInput.attr('data-placeholder'),
      maximumSelectionSize: 1,
      containerCssClass: "free-text-input",
      formatSelectionTooBig: ''
    });

    // Free text input overrides any selection from the options list.
    var freeTextContent = $freeTextInputField.val();
    if (freeTextContent) {
      selected = [{id: freeTextContent, text: freeTextContent}];
    }

    $freeTextInput.select2("data", selected);
    var $selectContainer = $selectOptions.siblings('.select2-container');

    $freeTextInput
        .on("change", function(e) {
          var selectedIDs = e.val;
          if (selectedIDs && selectedIDs.length > 0) {
            var selectedID = selectedIDs[0];
            var found = false;
            for (var i = 0; i < freeTextOptions.length; i++) {
              if (freeTextOptions[i].id === selectedID) {
                found = true;
                break;
              }
            }

            // Apply to hidden fields
            if (found) {
              $freeTextInputField.val('');
              $selectOptions.val(selectedID);
            } else {
              $selectOptions.val('');
              $freeTextInputField.val(selectedID);
            }

            $selectContainer.find('.select2-search-field').hide();
            $selectContainer.attr('tabIndex', '0');
            $selectContainer.focus();
          } else {
            $selectOptions.val('');
            $freeTextInputField.val('');
            $selectContainer.find('.select2-search-field').show();
          }
        });

    $selectContainer.on("click", function(){
      var selectedText = $selectContainer.find('.select2-search-choice').find('div').text();
      if (selectedText !== '') {
        $selectContainer.find('.select2-search-choice-close').click();
        $selectContainer.find('.select2-search-field').show();
        $selectContainer.attr('tabIndex', '-1');
        $freeTextInput.select2('search', selectedText);
      }
    });
  });

  // chosen select boxes for selecting patients in send forms / discussions / call patient
  var select2PlaceholderText =  $("select.select2").attr('data-placeholder');
  $(".select2").select2({
    placeholder: select2PlaceholderText,
    matcher: function (term, text) {
      var regex = '(?=.*?' + term.toUpperCase().replace(/ /gi,')(?=.*?') + ')^.*$';
      return RegExp(regex,'igm').test(text)
    }
  });

  $(".select2").on("change", function (e) {
    if(e.hasOwnProperty('added')) {
      $("#recipientId_"+e.added.id).prop('checked',true);
    } else if (e.hasOwnProperty('removed')) {
      $("#recipientId_"+e.removed.id).prop('checked',false);
    }
  });

  // chosen select boxes for selecting single patient ( used in startCall.jsp for eg )
  var $selectSingleRecipient = $("select.select-single-recipient");
  $selectSingleRecipient.select2({
    placeholder: "Click here to choose recipient",
    maximumSelectionLength: 1,
    matcher: function(term, text) {
      if($selectSingleRecipient.val() && $selectSingleRecipient.val().length >= 1){
        return null;
      }
      var regex = '(?=.*?' + term.toUpperCase().replace(/ /gi,')(?=.*?') + ')^.*$';
      return RegExp(regex,'igm').test(text)
    }
  });
  // set a default / preselected if present
  if($selectSingleRecipient.attr('data-preselected')){
    $selectSingleRecipient.select2("val", [$selectSingleRecipient.attr('data-preselected')]);
  }


  $(".select-single-recipient").on("change", function (e) {
    if(e.hasOwnProperty('added')) {
      $("#recipientId_"+e.added.id).prop('checked',true);
    } else if (e.hasOwnProperty('removed')) {
      $("#recipientId_"+e.removed.id).prop('checked',false);
    }
  });
}

function destroySelect2() {
  $(".free-text-select-freetext").select2("destroy");
}

function checkMandatoryFieldsAndToggleSubmitDisabled() {
  var $mandatoryFields = $("[data-validation*='mandatory-field']");
  toggleSubmitDisabled($mandatoryFields);
}

function toggleSubmitDisabled($mandatoryFields) {
  var $disabledUntilFilled = $("[data-validation*='disabled-until-filled']");
  if (!$disabledUntilFilled.length) {
    return;
  }

  if ($mandatoryFields.length) {
    if ($mandatoryFields.filter(function() { return isBlank($(this)) }).length === 0) {
      $disabledUntilFilled.prop("disabled", false);
    } else {
      $disabledUntilFilled.prop("disabled", true);
    }
  } else {
    $disabledUntilFilled.prop("disabled", false);
  }
}

function isBlank(element) {
  if (element.is("select")) {
    return $("#s2id_" + element.attr("id")).find(".select2-search-choice").length === 0;
  } else if (element.attr('type') === "checkbox") {
    return !element.is(":checked");
  } else {
    return element.val().trim() === "";
  }
}

