function Accessibility() {
    // Define values for keycodes
    var ENTER      = 13;
    var SPACE      = 32;
    var ESC        = 27;
    var TAB        = 9;
    var LEFT       = 37;
    var UP         = 38;
    var RIGHT      = 39;
    var DOWN       = 40;

    var self = this;

    $(document).ready(function () {
        new Utils(); //needed for "includes" on IE

        self.initSelect2Accessibility();

        //nasty hack to hide empty breadcrumb... I can't yet find a way of not rendering it using struts tags
        //so this is the easiest workaround for now.
        $('.page-head-title h1').add('li#breadcrumbPageTitle').each(removeIfHasBlankText);

        function removeIfHasBlankText() {
            var $element = $(this);
            if ($.trim($element.text()) === '') {
                $element.remove();
            }
        }

