        $(document).on("click", function (e) {
            var $target = $(e.target);

            //if this is an expandable menu focus the first option
            var controlsId = $target.attr("aria-controls");
            if ($("#" + controlsId) && $("#" + controlsId).attr("role") === 'menu') {
                $target.find("[role='menuitem']").first().focus();
            }
        });

        $(document).on("keypress", function (e) {
            var $target = $(e.target);

            //treat spacebar and enter key as clicks on elements that should function as buttons
            if ($target.hasClass("clickable-action") ||
                $target.attr("role") === "button") {
                if (e.which === ENTER || e.which === SPACE) {
                    e.preventDefault();
                    $(e.target).click();
                }
            }
        });

        $(document).on("keydown", function (e) {
            var $target = $(e.target);

            //radio buttons
            if ($target.attr("role") === "radio") {
                //move with arrow keys
                if ([UP, LEFT, DOWN, RIGHT].includes(e.which)) {
                    self.moveWithArrowKeys(e, $target.parents("[role='radiogroup']").find("[role='radio']"),
                        [UP, LEFT], [DOWN, RIGHT]);
                }
            }

            //menus
            if ($target.attr("role") === "menuitem") {
                //move with arrow keys
                if (e.which === UP || e.which === DOWN) {
                    self.moveWithArrowKeys(e, $target.parents("[role='menu']").find("[role='menuitem']"),
                        [UP], [DOWN]);
