  if (forceNHSRedirect) {
    nhsHome();
  } else {
    document.location = "/signoutRedirect.action?msg=timeout";
  }
}

function logoutOnConfirm() {
    document.location = "/signoutRedirect.action";
}

function inactivityAlert() {
  $("#inactivity-nr-of-minutes").html(Math.round(inactivityAlertTime/1000/60));
  var plannedLogoutTime = new Date(new Date().getTime() + logoutTime - inactivityAlertTime);
  $("#time-of-planned-logout").html(plannedLogoutTime.toLocaleTimeString(undefined, {
    hour: '2-digit',
    minute: '2-digit',
  }));
  $("#inactivity-alert-modal").modal('show');
}

var logoutTimer = null;
var inactivityTimer = null;

function resetLogout() {
  if(logoutTimer) {
    window.clearTimeout(logoutTimer);
  } // cancels the countdown.
  logoutTimer = window.setTimeout(logout,logoutTime); // reinitiates the countdown.

  if(inactivityTimer) {
    window.clearTimeout(inactivityTimer)
  }
  inactivityTimer = window.setTimeout(inactivityAlert, inactivityAlertTime);
}

function keepAlive() {
  var httpRequest = new XMLHttpRequest();
  httpRequest.open('GET', "/" , true);
  httpRequest.send();
  resetLogout();
}


window.onload = function() {
  resetLogout(); // initiates the countdown.
  if(window.jQuery){
    // bind the checker function to user events.
    jQuery(document).on("keypress mousemove click", resetLogout);
  }
};

